import React from "react";
import { Outlet } from "react-router";
import Log from "../components/Log";
import Poke from "../components/Poke";

const Authenticationlayout =()=>{
    return(
        <div>
            <nav className='bg-white w-full h-full'> 
            <div className="flex items-center justify-between p-10 h-20">
            <Log class='absolute h-10 w-10'/>
            <Poke/>
            <div >
                <label for="Email" class="flex justify-begin block text-sm font-medium text-gray-700">jij</label>
                <input type={"search"} id="email" className="w-full  px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900  rounded-md"/>
            </div>
            <div className='border-4 rounded-full border-slate-700'>
              <div className="rounded-full bg-pink-500 w-20 h-20 m-2 p-5"></div>
              </div>
            </div>

</nav>
           <div className='bg-slate-300 h-screen justify-center'>
            <Outlet />
            </div>


        </div>
    )
}
export default Authenticationlayout;
